import React from "react";

const Home: React.FC = () => {
  return (
    <div style={{ padding: "20px", maxWidth: "800px", margin: "0 auto" }}>
      <h1>Welcome to My Website</h1>
      <p>
        Hi, I'm Jack Pearson, a finance major and aspiring developer. This
        website hosts some of my projects and helps me sharpen my web
        development skills. Stay tuned as the site grows with new features and
        projects!
      </p>

      <h2>Current Projects</h2>
      <ul>
        <li>
          Forevergreen App ‚Äì <a href="#">Learn more</a>
        </li>
        <li>
          Research on Sustainable Markets ‚Äì <a href="#">View details</a>
        </li>
      </ul>

      <h3>üõ†Ô∏è Site Still in Development</h3>
      <p>(This just means I haven't linked it to any public profiles yet)</p>
      <p>This site is still pre-launch and I am constantly adding updates!</p>

      <p>
        Curious about my work? Feel free to{" "}
        <a href="#projects">explore my projects</a> or{" "}
        <a href="#contact">get in touch</a> with me!
      </p>
    </div>
  );
};

export default Home;
